import '../css/login.css';

function Login() {
    return (
        <section className="container-fluid">
            <form>
                <label htmlFor="username">Username:</label>
                <input type="text" id="username" name="username" />
                <label></label>
                <input type="text" id="username" name="username" />
            </form>
        </section>
      );
}

export default Login;
